@StevenDTX I have found that the name of the cookie varies, even when logged in.  So far I have only seen `eosAf` and `eosAn`.  This is a doubly URL encoded JSON string.  The access token is stored in a JSON key named either `access_token` or `a`.  Note that multiple permutations can be seen _in the same session_!  I have a working (though not the most efficient) solution that I have in a browser userscript.  It iterates over all the browser's cookies and looks for one that starts with a `%` as it will be the only one with the aforementioned JSON string.  From there, I decode that string and iterate over all its keys to find the longest, as that is always the string needed to be sent in the Authorization header.
```js
let cookies = document.cookie.split(';').map(function(x) {
	return x.trim().split(/(=)/);
}).reduce(function(a, b) {
	a[b[0]] = a[b[0]] ? a[b[0]] + ', ' + b.slice(2).join('') :
	b.slice(2).join('');
	return a;
}, {});
let token;
for(let i in cookies) {
	if(cookies[i].substr(0, 1) == '%') {
		let temp = JSON.parse(decodeURIComponent(decodeURIComponent(cookies[i])));
		let longest = 0;
		for(let j in temp) {
			if(temp[j].length > longest) {
				token = temp[j];
				longest = temp[j].length;
			}
		}
		break;
	}
}
```
From there I fetch the m3u8 link:
```js
fetch('https://api.discovery.com/v1/streaming/video/' + video.id, {
	headers: {
		'authorization': 'Bearer ' + token,
	},
}).then(function(result) {
	return result.json();
}).then(function(json) {
	//json.streamUrl is the episode's master m3u8
});
```


This method works fine even on the free episodes.

